import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';
import emailjs from 'emailjs-com';
// import { init } from 'emailjs-com';
// init("user_1I17qEirtZkLAh5ed5qOv");

function sendEmail(e) {
    e.preventDefault();

    emailjs.sendForm('service_olw30ew', 'template_2qz531s', e.target, 'user_1I17qEirtZkLAh5ed5qOv')
        .then(function (response) {
            console.log('SUCCESS!', response.status, response.text);
        }, function (error) {
            console.log('FAILED...', error);
        });
}

class Demo extends Component {
    render() {
        return (
            <div className="component_content demo">
                <Container>
                    <Row>
                        <Col xs={12} xl={6}>
                            <form className="contact-form" onSubmit={sendEmail}>
                                <input type="hidden" name="contact_number" />
                                <label>Name</label>
                                <input type="text" name="user_name" />
                                <label>Email</label>
                                <input type="email" name="user_email" />
                                <label>Message</label>
                                <textarea name="message" />
                                <input type="submit" value="Send" />
                            </form>

                            <h2 className="text-blue">Get a demo</h2>
                            <form>
                                <div className="form-group">
                                    <input type="text" id="name" placeholder="Name" className="form-control"/>
                                </div>
                                <div className="form-group">
                                    <input type="text" id="yacht" placeholder="Yacht" className="form-control"/>
                                </div>
                                <div className="form-group">
                                    <input type="email" id="email" placeholder="Email" className="form-control"/>
                                </div>
                                <div className="form-group">
                                    <input type="text" id="phone" placeholder="Phone" className="form-control"/>
                                </div>
                                <div className="form-group">
                                    <input type="text" id="location" placeholder="Location" className="form-control"/>
                                </div>
                                    <button type="submit" className="btn btn-primary">
                                        Submit
                                    </button>
                                </form>
                        </Col>
                        <Col xs={12} xl={6}>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Demo;
